INSERT INTO `explorer_info` VALUES (56,1,'You\'re vacationing in Happyville. Perhaps you should find your mom and dad and see if you can help them with anything.','A Night in the City'),(57,2,'Mom and Dad told you to find a man called Santa and help him prepare for the holiday festitivites. He should be nearby in the town of Happyville.','Finding a Jolly Old Man'),(58,3,'Taeng gave you a job of your choice and preferred for you to return at level 18. We should grind on some of those sticky things once more.','A New Profession'),(59,4,'Santa gave you a package of goods to deliver to Cliff. Santa told us Cliff should be in the town as well, dressed in red apparel.','Cliff, the Holiday Assistant'),(60,5,'You found Cliff and delivered Santa\'s supplies to him as required. It\'s time for you to head back to Santa for more tasks.','Package Delivered!'),(61,6,'Santa gave you a package of fire-works that should be in your USE inventory. Set them off and speak with Santa once more.','Setting Fire to the Skies'),(62,7,'You\'ve done quite a lot of work during the short time you had with Santa. It\'s time to find your parents and see what they\'ve been up to this whole time.','A Job Well Done'),(63,8,'Mom and Dad want you to find tickets for the hotel in Happyville. They said a man named Simon should be in charge of ticketing. You should find him nearby.','A Night in Happyville'),(64,9,'Simon decided to give you the tickets for free because of your job well done with Santa. This is fantastic. You should bring these tickets to them and tell them of the good news. ','A Night in Happyville : Part 2'),(65,10,'Your parents seemed ecstatic enough to give you a weapon of your choice. They also seemed to wish to speak to you again. You shouldn\'t keep them waiting.','A Night in Happyville : Part 3'),(66,11,'You\'ve checked into a remarkable hotel with glistening lights and a shining atmosphere. Talk with your parents to see attend to their needs.','A Night in Happyville : Part 4'),(67,12,'You were told to find Cliff once again. He seems to be running errands all over the place. Maybe it\'s a good time to give him a small break.','The Man in the Red Suit'),(68,13,'You were made a dedicated employee of Santa\'s staff and were welcomed to come back any time you wished. Mom and Dad should hear of this good news.','A Dedicated Employee'),(69,14,'The night at the inn was spectacular. You should see to your parents; perhaps it\'s time to leave.','A Peaceful Night'),(70,15,'You were separated from your parents during the ship ride. You should find them as soon as possible before the next train leaves you and your parents behind.','Lost at the Harbor'),(71,16,'The Explorers were once might warriors that possessed strength beyond recognition. They constantly strive for a better life. Your parents were oncethe greatest explorers of the land. They told you to pick up their mantle and become one yourself. One of the statues to the right should show you the way.','The Explorer Heritage'),(72,17,'You were teleported to a location elsewhere, and in your pockets you find potions and change. Your best bet would be to talk to the man to the right in the','The Man in the Weird Suit'),(73,18,'Taeng the Explorer seems to be in charge of the Explorer sect of Ellinia. Speak to him again to find out your first task.','Impatience is intolerable!'),(74,19,'Apparently Taeng believes you are too weak to be of any use of him. He told you to train on these things called Slimes in the area to the left until level 10.','Sticky and Slimy'),(75,20,'We reached level 10 and Taeng seemed quite pleased with your efforts. Speak to him again to discover his wishes.','Suited and Geared!'),(76,21,'Taeng gave you a job of your choice and preferred for you to return at level 18. We should grind on some of those sticky things once more.','A New Profession'),(77,22,'You were told to hunt monsters that yield green mushroom caps and leaves. Perhaps some traveling should be planned in your book from now on. You need to collect 60 leaves and 40 green mushroom caps. ','The Dirty Work'),(78,23,'You were given a pat on the back for a job well done. Stemming the tide of the monsters is an honorable job in any community.','The Dirty Work : Part 2'),(79,24,'Taeng has given you one more task, though he did mention it would be a tedious one. He wants you to collect 50 horny mushroom caps from monsters nearby Ellinia.','The Dirty Work : Part 3'),(80,25,'You completed the task set out before you and must train until you are stronger. Taeng said you may be ready for a test at level 30.','Settling Down'),(81,26,'Taeng spoke of an undercover agent down in the depths of a neutral town called Sleepywood. Find the agent and speak to him to recover information. The code word was \\r\\n\\\"#ePidgeon#n.\\\"','The Suspicious Man'),(82,27,'You found the suspicious looking agent that Taeng described in the depths of Sleepywood. You should talk to him and find out more about his discoveries.','Detective Work'),(83,28,'Apparently, Taeng wants you to investigate the Sleepywood Sauna and dig up answers to why the Loyalists are present in neutral territory. \\\"Start from the lower chain of command\\\", he said.','Detective Work : Part 2'),(84,29,'You spoke with Agent C, but he didn\'t seem to know the true secrets behind this covert operation. Perhaps speaking to another representative will help.','Detective Work : Part 3'),(85,30,'Agent O didn\'t seem to understand anything as well. At best, he was just as confused as Agent C was. Perhaps speaking with another agent will clarify this whole conundrum.','Detective Work : Part 4'),(86,31,'Score! You found some reasons to why the Cygnus Knights have arrived in Sleepywood. If you can manage to weasle some information from their commander you may report back to the undercover agent.','Detective Work : Part 5'),(87,32,'It seems the lead commander didn\'t wish to speak to the likes of you. You should report to the suspicious agent and present to him with what you have learned.','A Pat on the Back'),(88,33,'The agent was glad with what you had found. He seems to have another task in mind for you.','A Promotion Well Earned'),(89,34,'The agent congratulated you and decided to give you a promotion; however, he requested that you spend time at the Sleepywood Sauna to think things over. His advice is sound, and Lilin believes so, too. Why not give it a shot?','Something Amiss'),(90,35,'The receptionist was friendly enough, but she warned you to stay away from commotion. What does she mean? Is something terrible happening in the hotel?','Retaliation!'),(91,36,'Agent E ordered some of her agents onto you. Defeat them and settle this dispute with Agent E afterwards.','Aggression Rises'),(92,37,'The aggression in Sleepywood has reached an apex. You should speak with your agent for further instruction.','An Undercover Agent'),(93,38,'Your agent outfitted you in loyalist armor, worthy of the most infamous generals. He wishes to speak with you further, no doubt to coach you.','A Shadow Rises'),(94,39,'You have learned your verses and are ready to infiltrate the agents\' command structure. Speak with each of the agents accordingly.','The Stealthy One'),(95,43,'You possess the information needed to thwart the Loyalist schemes. Present the information to your agent to continue the job.','Cleaning Up Loose Ends'),(96,44,'The agent told you to confiscate any remaining documents. You\'ll have to bother Agent E one last time to finish the deed.','The Ends Are Tied'),(97,46,'With the deeds in the agent\'s hands, you\'ve been turned over to Taeng once more for further tasks. Report back to him at Ellinia.','Fighting Revenge'),(98,47,'Apparently there have been recent influxes of monsters throughout the continent. Taeng\'s supplies are constantly harrassed by beasts other than the loyalists. He\'s tasked you with the goal of eliminating a skeletal horde at Remains <Tomb> IV, and requested that you deliver to him 10 horse skulls and 50 pelvic bones.','The Lonely Bones'),(99,48,'You\'ve delivered the bones to Taeng the Explorer and he seems absolutely thrilled! You\'ve done a great job. Report back to him later for updates on the bones.','The Portals Into Darkness'),(100,49,'Taeng found traces of energy leading back to portals all around the continent. He\'s commanded that you enter one of them and investigate. Perhaps there\'s something to find, or something to kill ...','Beginnings of an Armistice'),(101,50,'The emblem seemed to have unnerved Taeng, who insisted that you visit Orbis to find a man named Agent M. You may talk to Taeng for further information on the matter.','A Blood Treaty with the Devils'),(102,51,'Agent M is drafting the treaty. Perhaps you should speak to him again; he seems to have finished outlining the core specifics.','A Treaty with the Devils'),(103,52,'It seems Agent M is confident in his signing of the armistice. The monster threat must be much larger than he expected. Bring the treaty back to Taeng in Ellinia.','A New Power In Mind?'),(104,53,'You\'ve successfully secured a treaty with the Knights of Cygnus to declare an armistice. You can be sure of total resistance toward the monster threat. Taeng wil continue to be your commanding officer. Report to him immediately. He seems to be eager to tell you something.l','A Well-Earned Promotion'),(105,54,'You have been promoted to a secondary Explorer, a title that is renowned in any explorer unit. Taeng insists that you return to him for more tasks; with the explorer threat growing one cannot be too lenient. It\'s time to face your foes with severe voracity.','Taking the Initiative'),(106,55,'Your first task involving the allegiance with the Loyalists concerns material goods and supplies for your newly found ally. Taeng has told you to leave for Perion and meet with the supplier.','Manji, the Silent One'),(107,56,'Manji was the supplier, but seemed quite interested in your abilities. She has given you the necessary supplies and it\'s your job to return them to Taeng as soon as possible. Perhaps you can speak to her another time ...','One for the Team'),(108,57,'You delivered the goods to Taeng and he thanked you for them. He asked you to come back later when he wasn\'t busy. Perhaps he has something to say to you?','Preparations to Strike'),(109,58,'Taeng told you of the stories of Ellinia, Perion, and Lith Harbor. He was full of memories and emotion. It was nice to finally hear and receive the stories of the old world from someone as experienced as he is.','A General of the Rebels'),(110,59,'Taeng promoted you to a general of the Rebel army so that you may lead the men into battle against the monsters. Your promotion has come long last, and he has given you your final set of skills for the coming battles. Taeng told you that you can receive your proper skills and training at Grendel the Really Old, who resides in his Magic Library at the top of Ellinia.','A Very Old Man'),(114,40,'Agent C was essentially useless and too shocked to say anything worthwhile.','An Explorer In A Guise I'),(115,41,'Agent O was a little more productive, but was unable to give us anything significant on the treaty.','An Explorer In A Guise II'),(116,42,'Agent P was a little more descriptive... they might be signing it now!','An Explorer In A Guise III'),(117,45,'We got the remaining copies. Let\'s get them to our agent to finalize everything','Ending Our Time Here');
/*!40000 ALTER TABLE `explorer_info` ENABLE KEYS */;
UNLOCK TABLES;

